import React from "react";
import axios from "axios";
const Test = () => {
    c
  axios
    .get(`https://jsonplaceholder.typicode.com/users`)
    .then((data) => {
      console.log(data.data);
    })
    .catch((err) => {
      console.log(err);
    });

  return <div>Test</div>;
};

export default Test;
